import React, { memo } from "react"
import { useSelector } from "react-redux"
import { Navigate } from "react-router"




const SearchPage = () => {
    const account = useSelector(state => state.account)
    const [search, setSearch] = useState('')
    const [people, setPeople] = useState([])
    const [posts, setPosts] = useState([])




    const handleSearch = () => {
        alert(search)
    }

    const handleExit = () => {
        dispatch({ type: 'CLEAR_ACCOUNT' })
    }

    if (account.username !== null) return <Navigate to="/login" />
    return (
        <>
            <div className=" row">
                <div className=" col-xxl-6">
                    <div className="card">
                        <div className="card-header bg-white fw-bold text-uppercase text-primary">mọi người</div>
                        <div className="card-body">

                        </div>
                    </div>
                </div>
            </div>
            <div className=" row">
                <div className=" col-xxl-6">
                    <div className="card">
                        <div className="card-header bg-white fw-bold text-uppercase text-primary">bài đăng gắn thẻ</div>
                        <div className="card-body">

                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default memo(SearchPage)
